import React from "react";
import { TFilter } from "../types";

type FiltersProps = {
  handleChangeComplete: (
    filterBy: string,
    name: string,
    value: boolean
  ) => void;
};

export default function Filters({ handleChangeComplete }: FiltersProps) {
  return (
    <div>
      <h1>Filters</h1>
      <div>
        <h2>Completed</h2>
        <label>
          <input
            type="checkbox"
            onChange={(event) =>
              handleChangeComplete(
                "completed",
                "completed",
                event.target.checked
              )
            }
          />
          <span>Completed</span>
        </label>
        <label>
          <input
            type="checkbox"
            onChange={(event) =>
              handleChangeComplete(
                "completed",
                "not-completed",
                event.target.checked
              )
            }
          />
          <span>Not Completed</span>
        </label>
      </div>
    </div>
  );
}
